import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';

import {Button} from "@mui/material";

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
      <Button>Material UI Button</Button>
  </React.StrictMode>
);
